P server.<\\/li><li><strong>epost templater<\\/strong> \\u2013 dette er templater som brukes av systemet n\\u00e5r epost sendes automatisk, for eksempel etter p\\u00e5melding, eller etter salg<\\/li><li><strong>epostvarslinger<\\/strong> \\u2013 du kan konfigurere hvilke varslinger du vil motta som merchant, og hvilke som er tilgjengelige for affiliater.<\\/li><\\/ul>Pass p\\u00e5 at epostkontoer setter opp ordentlig \\u2013 test \\u00e5 sende epost. Uten et fungerende epostsystem, vil ikke affiliater motta viktig informasjon.\"],[\"Customize your affiliate signup form\",\"Tilpass ditt affiliate p\\u00e5meldingsskjema\"],[\"GetStartedSignupForm\",\"Sjekk ut standard p\\u00e5meldingsskjema, og tilpass det hvis du vil.<br\\/><br\\/>\\r\\nP\\u00e5meldingsskjemaet kommer med en informativ mini-side som inneholder informasjon om programmet<br\\/>Du kan bruke mini-siden, eller slette det og lage ditt eget.\"],[\"Customize affiliate panel\",\"Tilpass affiliate kontrollpanel\"],[\"GetStartedAffPanel\",\"Affiliate panel i Post Affiliate Pro er veldig fleksibelt.<br\\/>Du kan konfigurere hvordan du vil at menyen skal se ut, hvilket innhold du \\u00f8nsker, og til og med skrive eget innhold eller linke til andre sider.\"],[\"GetStartedIntegrate\",\"Integrasjon er en metode \\u00e5 koble affiliatesystemet til din webside, handlevogn eller betalingsterminal, p\\u00e5 en m\\u00e5te som varsler affiliatesystemet om all aktivitet.<br\\/>\\r\\n<br\\/><br\\/>\\r\\nIntegrasjon betyr vanligvis at du legger til noen f\\u00e5 linjer mede kode p\\u00e5 dine websider, og det er forklart trinn for trinn i integrasjonsveilederen for de vanligste nettbutikker og betalingsl\\u00f8sninger. \"],[\"Test everything\",\"Test alt sammen\"],[\"GetStartedTest\",\"N\\u00e5r du har konfigurert dine kampanjer, definert korrekt provisjon, og opprettet noen bannere og linker, b\\u00f8r du teste systemet.<br\\/>\\r\\nDet beste er \\u00e5 simulere hele prosessen sett fra dine affiliaters st\\u00e5sted:\\r\\n<ol>\\r\\n<li>Opprett noen testaffiliater \\u2013 etter at de er godkjent b\\u00f8r du motta epost som bekrefter p\\u00e5meldingen inkludert passord, test om du kan logge inn i systemet<\\/li>\\r\\n<li>Logg inn i affiliatenes panel, se koden for bannere og linker og putt dem p\\u00e5 en testside<\\/li> \\r\\n<li>Klikk p\\u00e5 banneren for \\u00e5 se om klikket blir registrert<\\/li>\\r\\n<li>Etter klikket, pr\\u00f8v \\u00e5 gj\\u00f8re et testsalg og sjekk om salget og provisjonen ble registrert av systemet<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\nHvis du erfarer problemer under disse testene, aktiver <strong>Debug hendelseslogging<\\/strong> og se p\\u00e5 <strong>Probleml\\u00f8sning<\\/strong>\"],[\"Promote your affiliate program\",\"Reklamer for ditt affiliateprogram\"],[\"GetStartedPromote\",\"Etter at du har testet integrasjonen av affiliatesystemet med din webside, er alt klart for \\u00e5 reklamere for ditt nye affiliatesystem, for \\u00e5 tiltrekke nye affiliater \\u00e5 melde seg p\\u00e5.<br\\/><br\\/>\\r\\nDet er p\\u00e5krevd \\u00e5 sette en link til p\\u00e5meldingsskjemaet fra din egen webside, slik at nye affiliater finner det. Navngi linken Affiliate program Dette vil tiltrekke de bes\\u00f8kende og du kan konvertere dem til affiliater.<br\\/><br\\/>\\r\\nFor \\u00e5 n\\u00e5 flere potensielle affiliater, legg ut ditt program i affiliatekataloger p\\u00e5 nettet.\"],[\"Ad Channels\",\"Legg til kanal\"],[\"Advanced tools\",\"Avanserte verkt\\u00f8y\"],[\"Subaffiliate Sale Stats\",\"Subaffiliate salgsstatistikk\"],[\"ContactUs\",\"Kontakt oss\"],[\"Promotion tips\",\"Tips for annonsering\"],[\"Frequently asked questions\",\"Sp\\u00f8rsm\\u00e5l og svar\"],[\"Advanced tracking\",\"Avansert sporing\"],[\"DirectLinks explained\",\"Forklaring av DirekteLink\"],[\"Sale counts\",\"Telling av salg\"],[\"CTR (raw \\/ unique)\",\"CTR (alle \\/ unike)\"],[\"Design & Contents settings\",\"Innstilling Design & Innhold\"],[\"Payee info\",\"Betalingsmottaker info\"],[\"Co