t name\",\"Tast inn et unikt navn p\\u00e5 epostlisten\"],[\"Success signup URL\",\"URL etter vellykket p\\u00e5melding\"],[\"User will be redirected to this url in case he will confirm his registration in Mailing list. It is used in case Double Optin mechanism is used. If not defined, default message is displayed without redirection.\",\"Bruker vil bli redirigert til denne url i tilfelle han bekrefter sin registrering i epostlisten. Hvis ikke definert, vil standard melding bli vist uten redirigering.\"],[\"Double Opt-In\",\"Dobbel Opt-In\"],[\"Subscription to mailing list has to be confirmed by user. This is usually done by responding to a confirmation email sent to the email address in subsription request. This eliminates the chance of abuse where somebody submits somebody else's email address without their knowledge and against their will.\",\"P\\u00e5melding til epostlisten er bekreftet av brukeren. Dette blir gjort ved at brukeren m\\u00e5 svare p\\u00e5 epostmeldingen han f\\u00e5r etter p\\u00e5melding til epostlisten. Dette forhindrer muligheten for misbruk der brukeren angir en annen epostadresse enn sin egen.\"],[\"Newsletters\",\"Nyhetsbrev\"],[\"Here you can find list of your Mailing Lists. You can manage listings by editing existing or adding new Newsletter.\",\"Her kan du finne en oversikt over dine epostlister. Du kan administrere lister ved \\u00e5 redigere eller legge til nye nyhetsbrev.\"],[\"Add new Mailing list\",\"Legg til ny Mailinglist\"],[\"Other\",\"Andre\"],[\"For changes to take effect restart of application is needed. Do you want to restart now?\",\"For at endringer skal tre i kraft m\\u00e5 applikasjonen restartes. Vil du restarte n\\u00e5?\"],[\"Undefined\",\"Udefinert\"],[\"You have no private campaign\",\"Du har ingen private kampanjer\"],[\"You can contact us directly using this contact form. Your message will be sent to your affiliate manager by email.\",\"Du kan kontakte oss direkte ved \\u00e5 bruke dette skjemaet.\"],[\"Unique clicks\",\"Unike klikk\"],[\"Import selected\",\"Importer valgte\"],[\"Please wait, import of selected languages can take few minutes.\",\"Vennligst vent, import av valgte spr\\u00e5k kan ta noen minutter.\"],[\"Select your preferred theme for your affiliate panel.\",\"Velg ditt foretrukne theme.\"],[\"With performance reward rule you can reward your affiliates for their performace and motivate them to refer more customers to you.\",\"Med regel for bel\\u00f8nning basert p\\u00e5 ytelse, kan du bel\\u00f8nne affiliater for deres ytelse og motivere dem til \\u00e5 referere flere kunder.\"],[\"Apply for license key\",\"Aktiver for lisensn\\u00f8kkel\"],[\"Offline Validation Request\",\"Offline valideringsforesp\\u00f8rsel\"],[\"Simple PDF\",\"Enkel PDF\"],[\"If you want your campaign to have a special logo, specify it here.<br\\/>Logo will be visible to your affiliates.\",\"Hvis du \\u00f8nsker at din kampanje skal ha en spesiell logo, spesifiser den her.<br\\/>Logo vil v\\u00e6re synlig for affiliatene.\"],[\"Lifetime of cookie in days for this campaign. 0 means infinite. It defines for how many from the original referral your affiliate will get commissions.<br\\/>For example, if you specify 14 days, affiliate will get commissions for all sales coming for the 14 days since visitor last click on his link.\",\"Levetid for cookie i dager for denne kampanjen. 0 betyr uendelig. Den definerer hvor mange dager etter opprinnelig referral dine affiliater vil f\\u00e5 provisjoner.<br\\/>For eksempel, hvis du setter 14 dager, vil affiliaten f\\u00e5 provisjon for alle salg som kommer innen 14 dager etter at den bes\\u00f8kende sist klikket p\\u00e5 linken.\"],[\"Email notifications are disabled\",\"Varsling til epost er deaktivert\"],[\"Export file header template\",\"Eksporter fil header template\"],[\"Export file row template\",\"Eksporter filrad template\"],[\"Export file footer template\",\"Eksportfil footer template\"],[\"Username (email)\",\"Brukernavn (epost)\"],[\"You hav